import React from 'react';
import './App.css';

import YouTubeVideoListHolder from '../YouTubeVideoListHolder/YouTubeVideoListHolder';
import Header from '../Header/Header';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      apiResponse:[]
    };
  }

  /*
  generateList() {

  }

  render() {
    return (
      <div className="App">
        <Header />
        <YouTubeVideoListHolder video_list={this.state.video_list}/>
      </div>
    );

  }
  */

  callAPI() {
    fetch("http://localhost:9000/API")
      .then(res => res.text())
      .then(res => this.setState({apiResponse: res}))
      .catch(err => err);
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {
    return (
      <div className="App">
        <p>{this.state.apiResponse[1]}</p>
        <Header />
        <YouTubeVideoListHolder />
      </div>
    );
  }
}

export default App;
